import base64
from PIL import Image
from io import BytesIO


class Base64Converter:

    def convertFromBase64ToJPG(self,data):
        # print ("data in converter",data)
        im = Image.open(BytesIO(base64.b64decode(data)))
        finish = None
        finish = im.convert("RGB").save('accept.jpg', 'JPEG')
        if(finish):
            print ("Finish Do Converting")

    def unitTestBase64Converter(self):
        print ("Unit Test is called")
        data_test = ""
        self.convertFromBase64ToJPG(data=data_test)
